import React from "react";
import { Link } from "react-router-dom";
import { start } from "repl";
import { Car } from "../interface"

interface ICarModelProps{
    cars: Car;
}
export function CarModel(props:ICarModelProps){
    const {cars} = props;
    const {name, start_range, Time_to_60 ,top_speed, peak_power, base_price} = cars;
    return( 
        <div>
            <Link to={name.split(" ").join("")}>
            <p className="name">{name}</p>
            <p className="name">{start_range}</p>
            <p className="name">{Time_to_60}</p>
            <p className="name">{top_speed}</p>
            <p className="name">{peak_power}</p>
            <p className="name">{base_price}</p>
            </Link>
        </div>
    )
}
